import React from 'react';
// import unsplash from '../api/unsplash';
class Table extends React.Component{
    constructor(props){
    super(props);
    // state={

    // };
    }

    
    render(){
        console.log(this.props);
        return(
            <div>
                <table className="ui celled table">
                    <thead>
                        <tr>
                            <th>Form Id</th>
                            <th>Form Name</th>
                            <th># Submissions</th>
                            <th>Submit Page	</th>
                            <th>Submissions Page</th>
                    </tr>
                    </thead>
                    <tbody>{this.props.forms.map(function(item,key){
                        return(
                            <tr key={key}>
                            <td data-label="Form Id">{item.id}</td>
                            <td data-label="Form Name">{item.id}</td>
                            <td data-label="# Submissions">Engineer</td>
                            <td data-label="Submit Page">Engineer</td>
                            <td data-label="Submissions Page">Engineer</td>
                            </tr>
                         )
                        })}
                    </tbody>
                    </table>
                </div>
        );
    }
}

export default Table;
